import React from 'react';
import { makeStyles } from '@material-ui/styles';
import { Grid } from '@material-ui/core';

import {
    MyPublicUploads,
    MyUploads,
    SharedWithMePrivately,
    SharedWithMePublicly,
    TotalDocuments,
    TotalGlobalDocuments,
    TotalUsers,
    UploadCard
} from './components';

const useStyles = makeStyles(theme => ({
    root: {
        padding: theme.spacing(4)
    }
}));

const Dashboard = () => {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Grid
                container
                spacing={4}
            >
                <Grid
                    item
                    lg={3}
                    sm={6}
                    xl={3}
                    xs={12}
                >
                    <UploadCard/>
                </Grid>
                <Grid
                    item
                    lg={3}
                    sm={6}
                    xl={3}
                    xs={12}
                >
                    <TotalUsers/>
                </Grid>
                <Grid
                    item
                    lg={3}
                    sm={6}
                    xl={3}
                    xs={12}
                >
                    <TotalDocuments/>
                </Grid>
                <Grid
                    item
                    lg={3}
                    sm={6}
                    xl={3}
                    xs={12}
                >
                    <TotalGlobalDocuments/>
                </Grid>
                <Grid
                    item
                    lg={6}
                    sm={12}
                    xl={6}
                    xs={12}
                >
                    <MyUploads/>
                </Grid>
                <Grid
                    item
                    lg={6}
                    md={12}
                    xl={6}
                    xs={12}
                >
                    <MyPublicUploads/>
                </Grid>

                <Grid
                    item
                    lg={6}
                    md={12}
                    xl={6}
                    xs={12}
                >
                    <SharedWithMePublicly/>
                </Grid>
                <Grid
                    item
                    lg={6}
                    md={12}
                    xl={6}
                    xs={12}
                >
                    <SharedWithMePrivately/>
                </Grid>
            </Grid>


        </div>
    );
};

export default Dashboard;
